import "./styles.css"

export const PostCard = ({ post }) => { //Comum fazer destructuring com algo que esteja dentro da props


  return (
    <div className="post">
      <img src={post.cover} alt={post.title} />
      <div className="post-content">
        <h1>{post.title}</h1>
        <p>{post.body}</p>
      </div>
    </div>
  );
};
